import React from 'react';
import { BrowserRouter } from 'react-router-dom'; 
import { library } from '@fortawesome/fontawesome-svg-core';

import Header from './components/Header'
import Routes from './routes';


function App() {
  return (
     <BrowserRouter>
      <Header />
      <Routes /> 
     </BrowserRouter>
  );
}
export default App;
